import React from 'react'
import {
    Box,
    Grid2,
    Typography,
    Container,
    Button,
    Paper
} from '@mui/material';

const Form = () => {
    return (
        <Paper variant='outlined'>
            <Grid2 container component='form'>FormText2Image</Grid2>
        </Paper>
    )
}

export default Form
